A reducer is a function that receives a state and an action and transforms it in another state. It has an initial state and uses the action type to decide what it needs to do. The way we type the state helps us with the data management. export type ParentsState = | { tag: "UNLOADED" } | { tag: "LOADING" } | { tag: "ERROR" } | { tag: "LOADED", parents: Parent[], }; The tags "UNLOADED", "LOADING" and "ERROR" can be easily treated in the component and we can be assured that the data we want is loaded and without errors. Using this typing we have two different scenarios. One where the data isn't ready – either because it's loading or because an error occured with the get API request – and another where it is and can be modified. In our reducer, we'll treat those scenarios in two separate switch. The initial state will be "UNLOADED". Then, after the GET API Request, it can result in an error or success. The state returned by the first switch wil make it clear. export default function parents( state: ParentsState = initialState, action: ParentsAction
): ParentsState { if (state.tag !== "LOADED") { switch (action.type) { case "GET_PARENTS_LOADING": return { tag: "LOADING" }; case "GET_PARENTS_ERROR": return { tag: "ERROR" }; case "GET_PARENTS_OK": return { tag: "LOADED", parents: action.data }; default: return state; } } [...] The second switch can assume that the data is loaded and ready to be manipulated, so it has actions like PUT and DELETE. It returns the already loaded state, with the modifications made within the application. [...] switch (action.type) { case "PUT_PARENT": return { ...state, parents: state.parents .filter((p) => p.userId !== action.data.userId) .concat(action.data), }; case "DELETE_PARENT": return { ...state, parents: state.parents.filter((p) => p.userId !== action.data), }; default: return state; }
} Notice that every reducer receives all of the page messages (GET_SCHOOLS, PUT_STUDENTS, etc), these actions shouldn't modify the state of this reducer, so we need a default that returns the current state.

