You can think of an action as an event that describes something that happens in our application. It always has a type property, which makes it clear what's going on, and it may have a data property. We use them specially to enclose our API calls, and we define a type that has each of our routes or events. export type ParentsAction = | { type: "GET_PARENTS_ERROR" } | { type: "GET_PARENTS_LOADING" } | { type: "GET_PARENTS_OK", data: Parent[] } | { type: "PUT_PARENT", data: Parent } | { type: "DELETE_PARENT", data: string }; Notice that the type makes explict what is happening in the application. We then define functions that will make the api requests and dispatch one of the action types. The dispatch is used to trigger the reducer. The get something action is one of the most common, it is used to request the data from the API. When it starts, it makes a dispatch to modify the state to "LOADING". After the request is finished, it makes another dispatch that will depend if everything went right. export function getParentsAction(): ThunkAction<Promise<void>> { return async (dispatch) => { dispatch({ type: "GET_PARENTS_LOADING" }); try { const response = await apiRequest<any[]>({ url: "owner/parents" }); const data = normalizeParents(response.data); dispatch({ type: "GET_PARENTS_OK", data: data }); } catch { dispatch({ type: "GET_PARENTS_ERROR" }); } };
} We use ThunkAction as a way to turn dispatch into an async function. We also have the actions that deal with PUT, POST and DELETE API Requests. It is similar to the GET action because it also waits for an API request and then makes a dispatch. The main differences are: it will modify something in the data that is already loaded, so we don't have to dispatch the loading; and it usually has a return that indicates if it was succesful or not. This way the components can deal with errors. export function putParentAction( name: string, phoneNumber: string, parentId: string
): ThunkAction<Promise<Result>> { return async (dispatch, getState) => { const parentsState = getState().parents; if (parentsState.tag !== "LOADED") return err({}); const editedParent = parentsState.parents.find( (p) => p.userId === parentId ); if (!editedParent) return err({}); editedParent.name = name; editedParent.phoneNumber = phoneNumber; try { await apiRequest({ url: `owner/parent/${parentId}`, method: "PUT", data: { name, phoneNumber, }, }); dispatch({ type: "PUT_PARENT", data: editedParent }); return ok({}); } catch { return err({}); } };
} Notice that with ThunkAction we can use getState() to access the current state.

